import React from 'react';
import slider1 from './img/slider1.jpg';
import slider2 from './img/slider2.jpg';

class Slider extends React.Component {
    render() {
        return (
            <div className="slider">
                <img src={slider1} alt="" />
                <img src={slider2} alt="" />
            </div>
        )
    }
}

export default Slider;
